// src/components/SubmitPage.jsx
import React from "react";

export default function SubmitPage() {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold">Submit a Barbershop</h1>
      <p className="text-gray-600 mt-2">This is where users can submit a new barbershop listing.</p>
    </div>
  );
}
